/* import logo from './logo.svg'; */
import "./App.css";
import HeroImg from "./components/heroImage";
import List from "./components/list";
import Table from "./components/table";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <h1>Today's task.</h1>
      </header>
      <HeroImg />
      <List />
      <Table />
    </div>
  );
}

export default App;
